import { Link } from "react-router-dom";
import About from "./About";

const Button = ({ buttonText }) => {
    return (
        <button
            className={buttonText}
            type="submit"
            onClick={() => {
                <Link>
                    <About />
                </Link>;
            }}
        >
            {buttonText}
        </button>
    );
};

export default Button;
